import React from 'react'
import Typist from 'react-typist';
import ForumIcon from '@material-ui/icons/Forum';
function Home() {
    return (
        <div className='homeContainer'>
            <Typist>
                Welcome To Magic Chat App.
            <Typist.Delay ms={500} />
                <br />
                <p></p>
                <span>Developed By Nishant Rana.</span>
            </Typist>
        </div >
    )
}

export default Home
